import React from 'react';
import '../../App.css'
import './Header.scss'
import HeaderMenu from "./Header-menu";

const Header = () => {
    return (
        <header className='header'>
            <div className='container container__header'>
                <div className='header__logo'>
                    Portfolio
                </div>
                <div>
                  <HeaderMenu/>
                </div>
            </div>
        </header>

    );
};

export default Header;
